import React, { Component } from 'react';
import SelectPanel from "./select/SelectPanel";
import RecentResults from "./results/RecentResults";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
class SelectPanelPage extends Component<any, { infoOptions: any, selectedOption: any}> {
    render() {
        return (
            <Router>
                <div className={"flex flex-col justify-center items-center h-full w-full bg-amber-100"}>
                    <div className={"text-5xl text-red-950 m-4 p-8"}>F1 Tracker</div>
                    <SelectPanel/>
                    <Route path="/recentpage" element={<RecentResults/>} />
                </div>
            </Router>
        );
    }
}

export default SelectPanelPage;
